  return (
    <div className="App">
        <Router>
      <header className="App-header">Natter
          <Nav />
      </header>
      <main>
          <Switch>
            <Route path="/buzzwords">
              <Buzzwords />
            </Route>
            <Route path="/nats">
              <Nats handleUserClick={setSelectedUser} />
